import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link, useLocation  } from "react-router-dom";
import { useEffect } from 'react';
import Main from './MainPage/Main';
import Premise from './Premise/Premise';
import Authorization from './AuthorizationPage/Authorization';

function App() {
    useEffect(() => {
        // Ваше действие после перехода на новую страницу
        console.log('Вы находитесь на странице', location.pathname);
      }, [useLocation()]);

      
    return (
        
        <Router>
                <Routes>
                    <Route path="/login" element={<Authorization/>}/>
                    <Route path="/main" element={<Main/>}/>
                    <Route path="/premise" element={<Premise/>}/>
                </Routes>
        </Router>
    );
}

export default App;
